<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta http-equiv="X-UA-Compatible" content="IE=edge">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Document</title>
    <style>
           .handle{
        animation: handle_rotate 5s infinite;
        animation-delay: 0s;
        transform-origin:78px 107px;
        
        
      }
      @keyframes  handle_rotate{
        
        33%{transform: rotate(0deg);}
        64% {transform: rotate(20deg);}
        70%{transform: rotate(0deg);}
        100%{transform: rotate(0deg);}
        
          } 

          .drop{
            stroke: #55220000;
            fill: #55220000;
            animation: dropfall 1s infinite;
            animation-delay: 0s;
            animation-timing-function: ease-in;
            
            
          }
          @keyframes  dropfall{
            
            0% {stroke: #55220000;fill: #55220000;}
            10% {transform: translateY(0px);stroke: #552200ff;fill: #552200ff;}
            100% {transform: translateY(15px);stroke: #552200ff;fill: #552200ff;}
            
              }


              .cupforward{
            
            animation: cupforw 5s infinite;
            animation-delay: 0s;
            animation-timing-function: linear;
            
            
          }
          @keyframes  cupforw{
            
            30% {transform: translateX(29px);}
            70% {transform: translateX(29px);}
            95% {transform: translateX(59px);}
            100%{transform: translateX(59px);}
            
              }

              .coffee{
            
            animation: pour 5s infinite;
            animation-delay: 0s;
            animation-timing-function: ease-in;
            fill: #552200ff;
            stroke: #552200ff;
            
            
          }
          @keyframes  pour{
            
            
            30% {transform: translateY(0px);stroke: #552200ff;fill: #552200ff;}
            67% {transform: translateY(35px);stroke: #552200ff;fill: #552200ff;}
            68%{stroke: #55220000;fill: #55220000;}
            100% {transform: translateY(35px);stroke: #55220000;fill: #55220000;}
            
              }

              .needle{
        animation: needle_rotate 5s infinite;
        animation-delay: 0s;
        transform-origin:39.6px 62px;
        
        
      }
      @keyframes  needle_rotate{
        
        30%{transform: rotate(0deg);}
        70% {transform: rotate(360deg);}
        
        100%{transform: rotate(0deg);}
        
          } 
              
    </style>
</head>
